import React from 'react'

const TodoItem = ({name, done, id}) => {
    return (
        <div className='todoItem'>
            <Checkbox
            checked={state.checkedB}
            onChange={handleChange}
            name="checkedB"
            color="primary"
          />
            <p className={done && 'todoItem--done'}>{name}</p>
        </div>
    )
}

export default TodoItem
